import React from 'react';
import ReactQuill from 'react-quill';
import 'react-quill/dist/quill.snow.css';
import { useParams } from 'react-router-dom';
import { PageInfoContext } from '../../PageInfoContext';



export const DetailPage: React.FC = () => {
    const { id } = useParams<{ id: string }>();
    const { setPageInfo } = React.useContext(PageInfoContext)!;
    // 示例活动详情数据 - 在实际应用中，这些数据可能来自 API 请求
    const activityDetails : { [key: string]: any }= {
        "001": {
            title: "活动一",
            content: `<h1>活动一简介</h1>
                <p>这是一个关于如何组织和参与社区服务活动的详细指南。活动包括了从准备到执行的每一个步骤。</p>`
        },
        "002": {
            title: "活动二",
            content: `<h1>AWS 官方宣传</h1><p><br></p><p><img src="data:image/png;base64,"></p><p><br></p><p><br></p><ol><li>阿德的的 </li><li>本地哈啥的</li><li>23级2 </li></ol><p><br></p><p><br></p>`
        }
    };
    const [detail, setDetail] = React.useState<any | undefined>(undefined);
    const [content, setContent] = React.useState<string>('');
    React.useEffect(() => {
        if (id && activityDetails[id]) {
            setDetail(activityDetails[id]);
            setContent(activityDetails[id].content);
        } else {
            setDetail(undefined);
        }
    }, [id]);
    React.useEffect(() => {
       console.log(content);
    }, [content]);
    React.useEffect(() => {
        if (detail) {
            setPageInfo(detail.title);
        }
    }, [detail, setPageInfo]);
    const quillRef = React.useRef<any>(null);
    const modules = {
        toolbar:false
        //  [
        //   [{ 'header': [1, 2, false] }],
        //   ['bold', 'italic', 'underline','strike', 'blockquote'],
        //   [{'list': 'ordered'}, {'list': 'bullet'}, {'indent': '-1'}, {'indent': '+1'}],
        //   ['link', 'image'], // 这里添加了'image'按钮
        //   ['clean']
        // ],
      };
    
      const formats = [
        'header',
        'bold', 'italic', 'underline', 'strike', 'blockquote',
        'list', 'bullet', 'indent',
        'link', 'image'
      ];
    return (
        <div style={{ padding: '0px' }}>
            {detail ? (
                <>
                {/* 使用 react-quill 渲染富文本内容 */}
                    <ReactQuill ref={quillRef} value={content} readOnly={true}   onChange={setContent}
                        theme="snow" 
                        modules={modules}
                        formats={formats}
                        />
                </>
            ) : (
                <p>活动未找到。</p>
            )}
        </div>
    );
};